import React from "react";
import "./card-style.css";
import Typography from "@material-ui/core/Typography";
import Button from "@material-ui/core/Button";

function clickShare() {
  if (this.getAttribute("data-add")) {
    share.classList.add(this.getAttribute("data-add"));
  }

  if (this.getAttribute("data-remove")) {
    share.classList.remove(this.getAttribute("data-remove"));
  }
}

function Card(props) {
  return (
    <div className="card text-center shadow">
      <div className="overflow">
        <img src={props.card.imgsrc} alt="" />
      </div>
      <div className="card-body text-dark">
        <h4 className="card-title">{props.card.title}</h4>

        <Typography
          className="card-text text-secondary"
          variant="body2"
          color="textSecondary"
          component="p"
        >
          {props.card.text}
        </Typography>

        <Button
          className="btn btn-outline-success"
          size="large"
          onclick="location.href='http://www.example.com'"
          type="button"
          style={{ color: "black", fontWeight: "bold" }}
        >
          <svg
            className="share shared-now"
            xmlns="http://www.w3.org/2000/svg"
            width="75"
            height="48"
            viewBox="0 0 24 24"
          >
            <text className="my-shape" x="12" y="14" fontSize="5" fill="black">
              Share
            </text>

            <path fill="none" d="M0 0h24v24H0V0z" />
            <path
              className="my-shape"
              d="M18 16.08c-.76 0-1.44.3-1.96.77L8.91 12.7c.05-.23.09-.46.09-.7s-.04-.47-.09-.7l7.05-4.11c.54.5 1.25.81 2.04.81 1.66 0 3-1.34 3-3s-1.34-3-3-3-3 1.34-3 3c0 .24.04.47.09.7L8.04 9.81C7.5 9.31 6.79 9 6 9c-1.66 0-3 1.34-3 3s1.34 3 3 3c.79 0 1.5-.31 2.04-.81l7.12 4.16c-.05.21-.08.43-.08.65 0 1.61 1.31 2.92 2.92 2.92s2.92-1.31 2.92-2.92c0-1.61-1.31-2.92-2.92-2.92zM18 4c.55 0 1 .45 1 1s-.45 1-1 1-1-.45-1-1 .45-1 1-1zM6 13c-.55 0-1-.45-1-1s.45-1 1-1 1 .45 1 1-.45 1-1 1zm12 7.02c-.55 0-1-.45-1-1s.45-1 1-1 1 .45 1 1-.45 1-1 1z"
            />
          </svg>
        </Button>

        <Button size="large" color="primary">
          <a href="/"> Learn More </a>
        </Button>
      </div>
    </div>
  );
}

export default Card;
